import {
  Canvas,
} from '@react-three/fiber'
import {
  Grid,
} from '@mui/material';
import * as React from 'react'
import * as THREE from 'three'

import Info from './components/Info';
import Wire from './components/Tube'

const canvasStyle = {
  height: '100%',
  position: 'absolute',
  left: '0',
  width: '100%',
  overflow: 'hidden',
}

function App() {

  return (
    <>
      <Grid container>
        <Grid container item sm={12} justifyContent="flex-end">
          <Info />
        </Grid>
        <Grid container item sm={12}>
          <Canvas style={canvasStyle}>
          </Canvas>
        </Grid>
      </Grid>
    </>
  );
}

export default App;
